class ExplainerPlugin(base_plugin.TBPlugin):
    """A plugin that serves greetings recorded during model runs."""

    # This static property will also be included within routes (URL paths)
    # offered by this plugin. This property must uniquely identify this plugin
    # from all other plugins.
    plugin_name = 'explainer'

    def __init__(self, context):
        """Instantiates a ExplainerPlugin.

        Args:
          context: A base_plugin.TBContext instance. A magic container that
            TensorBoard uses to make objects available to the plugin.
        """
        # We retrieve the multiplexer from the context and store a reference
        # to it.
        self._multiplexer = context.multiplexer
        self._multiplexer._size_guidance['tensors'] = 10000  # [@TS] This line makes it possible to return more than 10 steps / tag. TODO: Is there a cleaner way?

    def get_plugin_apps(self):
        """Gets all routes offered by the plugin.

        This method is called by TensorBoard when retrieving all the
        routes offered by the plugin.

        Returns:
          A dictionary mapping URL path to route that handles it.
        """
        # Note that the methods handling routes are decorated with
        # @wrappers.Request.application.
        return {
            '/weights': self.weights_route,

            # @TS: from graph plugin
            '/graph': self.graph_route,
            '/runs': self.runs_route,
            '/run_metadata': self.run_metadata_route,
            '/run_metadata_tags': self.run_metadata_tags_route,
        }

    def is_active(self):
        """Determines whether this plugin is active.

        This plugin is only active if TensorBoard sampled any summaries
        relevant to the explainer plugin.

        Returns:
          Whether this plugin is active.
        """
        all_runs = self._multiplexer.PluginRunToTagToContent(
            ExplainerPlugin.plugin_name)

        # The plugin is active if any of the runs has a tag relevant
        # to the plugin.
        # return bool(self._multiplexer and any(six.itervalues(all_runs)))
        return True

    def _tensor_event_to_string(self, tensor_event):
        """Convert a TensorEvent into a JSON-compatible response."""
        np_array = tf.make_ndarray(tensor_event.tensor_proto)

        if np_array.min() == 0 and np_array.max() == 0:
            hist = np.array([np_array.size])
            bin_edges = np.array([np.nextafter(0, -1), np.nextafter(0, 1)])
        else:
            (hist, bin_edges) = np.histogram(a=np_array,
                                             bins=20,
                                             density=True)
        return {
            'wall_time': tensor_event.wall_time,
            'step': tensor_event.step,
            'content': {
                # 'raw': np_array.tolist(),
                'min': np_array.min(axis=None),
                'max': np_array.max(axis=None),
                'mean': np_array.mean(),
                'median': np.median(np_array),
                'stddev': np_array.std(),
                'histogram': {'hist': hist.tolist(),
                              'bin_edges': bin_edges.tolist()},
            },
        }

    @wrappers.Request.application
    def weights_route(self, request):
        return http_util.Respond(request, EXPLAINER_DEMO_DATA, 'application/json')

    """###########################
    ### @TS: from graph plugin ###
    ###########################"""

    @wrappers.Request.application
    def runs_route(self, request):
        index = self.index_impl()
        return http_util.Respond(request, index, 'application/json')

    @wrappers.Request.application
    def run_metadata_tags_route(self, request):
        index = self.run_metadata_index_impl()
        return http_util.Respond(request, index, 'application/json')

    @wrappers.Request.application
    def graph_route(self, request):
        """Given a single run, return the graph definition in protobuf format."""
        run = request.args.get('run')
        if run is None:
            return http_util.Respond(
                request, 'query parameter "run" is required', 'text/plain', 400)

        limit_attr_size = request.args.get('limit_attr_size', None)
        if limit_attr_size is not None:
            try:
                limit_attr_size = int(limit_attr_size)
            except ValueError:
                return http_util.Respond(
                    request, 'query parameter `limit_attr_size` must be an integer',
                    'text/plain', 400)

        large_attrs_key = request.args.get('large_attrs_key', None)

        try:
            result = self.graph_impl(run, limit_attr_size, large_attrs_key)
        except ValueError as e:
            return http_util.Respond(request, e.message, 'text/plain', code=400)
        else:
            if result is not None:
                (body, mime_type) = result  # pylint: disable=unpacking-non-sequence
                return http_util.Respond(request, body, mime_type)
            else:
                return http_util.Respond(request, '404 Not Found', 'text/plain',
                                         code=404)

    @wrappers.Request.application
    def run_metadata_route(self, request):
        """Given a tag and a run, return the session.run() metadata."""
        tag = request.args.get('tag')
        run = request.args.get('run')
        if tag is None:
            return http_util.Respond(
                request, 'query parameter "tag" is required', 'text/plain', 400)
        if run is None:
            return http_util.Respond(
                request, 'query parameter "run" is required', 'text/plain', 400)
        result = self.run_metadata_impl(run, tag)
        if result is not None:
            (body, mime_type) = result  # pylint: disable=unpacking-non-sequence
            return http_util.Respond(request, body, mime_type)
        else:
            return http_util.Respond(request, '404 Not Found', 'text/plain',
                                     code=404)

    def run_metadata_index_impl(self):
        """Returns a run-to-tag mapping for metadata."""
        return {
            run_name: run_data[event_accumulator.RUN_METADATA]
            for (run_name, run_data) in self._multiplexer.Runs().items()
            if event_accumulator.RUN_METADATA in run_data
        }

    def index_impl(self):
        """Returns a list of all runs that have a graph."""
        return [run_name
                for (run_name, run_data) in self._multiplexer.Runs().items()
                if run_data.get(event_accumulator.GRAPH)]

    def graph_impl(self, run, limit_attr_size=None, large_attrs_key=None):
        """Result of the form `(body, mime_type)`, or `None` if no graph exists."""
        try:
            graph = self._multiplexer.Graph(run)
        except ValueError:
            return None
        # This next line might raise a ValueError if the limit parameters
        # are invalid (size is negative, size present but key absent, etc.).
        process_graph.prepare_graph_for_ui(graph, limit_attr_size, large_attrs_key)
        return (str(graph), 'text/x-protobuf')  # pbtxt

    def run_metadata_impl(self, run, tag):
        """Result of the form `(body, mime_type)`, or `None` if no data exists."""
        try:
            run_metadata = self._multiplexer.RunMetadata(run, tag)
        except ValueError:
            return None
        return (str(run_metadata), 'text/x-protobuf')  # pbtxt
